import React from 'react'

// function Greet ( ) {
//     return <h1> Hello Tahina </h1>
// }

const Greet = (props) => {
    return <><h1> Hello {props.name} {2+2} </h1>
           <h2> My {props.identity}</h2>
           </>
}

export default Greet;
